import React from 'react';
import './style.css';

const Project = () => {
    return (
        <section id='projetos'>
          <h2>Meus Projetos</h2>
          <ul>
            <li>
              <h3>Aplicativo Mobile para Gerenciamento de Bovinos em 
                Propriedades Rurais</h3>
              <p>O projeto "Aplicativo Mobile para Gerenciamento de Bovinos 
                em Propriedades Rurais: Uma Ferramenta Eficaz para Melhorar 
                a Produção" é uma solução inovadora destinada a auxiliar pequenos
                 e médios produtores rurais na gestão eficiente de suas propriedades. O sistema oferece funcionalidades intuitivas e práticas, como cadastramento de lotes, calendário de eventos, conversão de peso, calculadora de rações e controle financeiro. Essas ferramentas visam otimizar a produção pecuária, facilitando o acompanhamento de vacinas, reprodução, alimentação e transações financeiras. Com um design simples e amigável, o aplicativo promete simplificar o dia a dia dos produtores, melhorando a tomada de decisões e aumentando a rentabilidade das propriedades rurais.</p>
              <a href="https://github.com/kfrural/projeto1">Ver Projeto 1</a>
            </li>
            <li>
              <h3>Projeto 2</h3>
              <p>Descrição do Projeto 2</p>
              <a href="https://github.com/kfrural/projeto2">Ver Projeto 2</a>
            </li>
            {/* Adicione mais projetos aqui */}
          </ul>
        </section>
      );
  }

  export default Project;
